import { NavLink } from 'react-router-dom';


export default function NavBar() {
  return (
        <div className="container">
        <nav className="navbar navbar-">
        <a className="nav-link">Articles</a>
                <NavLink to="/articles" activeClassName="selected"> </NavLink>
                <NavLink to="/" activeClassName="selected" className="nav-link">Home</NavLink>
                <NavLink to="/articles/new" activeClassName="selected" className="nav-link">Create</NavLink>

        </nav>
        </div>
  )
}
